import { useQuery } from 'react-query'
import { getSearchListApi } from 'services/bookSearchApi'
import styles from './bookList.module.scss'

interface Props {
  author: string
}

interface Items {
  authors: string[]
  contents: string
  datetime: Date
  isbn: string
  price: number
  publisher: string
  sale_price: number
  status: string
  thumbnail: string
  title: string
  translators: any[]
  url: string
}

const BookList = ({ author }: Props) => {
  const { data } = useQuery(['getSearchListApi', author], () => getSearchListApi(author).then((res) => res.data), {
    enabled: !!author,
  })

  const bookItems = data.documents.map((item: Items) => (
    <li key={item.isbn}>
      <img className={styles.bookImg} src={item.thumbnail} alt={`${item.title}_img`} />
    </li>
  ))

  return <ul className={styles.bookList}>{bookItems}</ul>
}

export default BookList
